function createRegexObj(string) {
	var lowerCaseString = string.toLowerCase();
	return new RegExp(lowerCaseString);
}

var filter = function (collection, regex) {
    return _.filter(collection, function(contact){
    	var answer = false;
    	if (typeof contact.name === "string"){
    		var name = contact.name.toLowerCase();
    		var name_answer = regex.test(name)
    	} else {
    		name_answer = false	
    	}
    	var email = contact.address.toLowerCase();
    	var email_answer = regex.test(email)
    	if (email_answer || name_answer) {
    		answer = true
    	}
    	 return answer
    })
};